import React, { useEffect, useState } from "react";
import { Outlet } from "react-router-dom";
import Log from "./Log";
import axios from "axios";
function Pr() {
  const [per, setper] = useState(false);
  useEffect(async () => {
    const ud = sessionStorage.getItem("ud");
    await axios
      .post("/pr", {
        ud: ud,
      })
      .then((res) => {
        if (res.data.per === "ac") {
          setper(true);
        } else {
          setper(false);
        }
      });
  });
  return per ? <Outlet /> : <Log />;
}
export default Pr;
